script: |
  super -f text -I q10783.spq | sort > q10783.out

inputs:
  - name: q10783.spq
    data: |
      SELECT ALL - col1 FROM tab0 (FORMAT parquet) WHERE col2 / col0 * + + col0 NOT IN ( - 73, col2 * - col0, - col1 );
  - name: tab0

outputs:
  - name: q10783.out
    data: |
      -1
      -21
      -81
